import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import "../../../css/Client/home.css";


export function StateDetail() {
  const { id } = useParams();
  const [casa, setCasa] = useState(null);

  useEffect(() => {
    fetch(`http://localhost:3001/verInmueble/${id}`)
      .then(response => response.json())
      .then(response => {
        setCasa(response);
        console.log(response);
      })
      .catch(error => {
        console.error('Error:', error);
        setCasa(null); // Puedes establecer casa en null o manejarlo de otra manera según tus necesidades
      });
  }, [id]);
  



  return (
    <div>
      <h2 className="txt-black">Detalles del Inmueble</h2>
      {casa ? (
        <>
          <div className='header-info-detail'>
            <h3 className='txt-black'></h3>
          </div>
        </>
      ) : (
        <p>Cargando detalles del inmueble...</p>
      )}
    </div>
  );
  
}
